import React, { Component } from 'react'
import curnet from './index.module.css'
import Dashboard from '../../components/Chart/Dashboard'



export default class index extends Component {

  state = {
  };


  constructor(props) {
    super(props)
   }

   componentDidMount() {

   }


  render() {
    return (
      <div className={curnet.container}>
        <div className={curnet.top}>
          <span className={curnet.top_span_1}></span>
          <span className={curnet.top_span_2}></span>
          <span className={curnet.top_span_3}></span>
        </div>
        <div className={curnet.center}>
          <Dashboard/>
        </div>
        <div className={curnet.bottom_1}></div>
        <div className={curnet.bottom_2}>
          <span className={curnet.bottom_2_item}></span>
          <span className={curnet.bottom_2_item}></span>
          <span className={curnet.bottom_2_item}></span>
        </div>
      </div>
    )
  }

}
